import React from 'react'
import './Square'

const styles = {
    background: '#fff',
    border:' 1px solid #999',
    float: 'left',
    fontSize: '24px',
    fontWeight: 'bold',
    lineHeight: '34px',
    height: '34px',
    marginRight: '-1px',
    marginTop: '-1px',
    padding: 0,
    textAlign: 'center',
    width: '34px'
}

class Square extends React.Component {
    render() {
        return(
            <div style={styles}>
           <button className='square'>
               {this.props.value}
           </button>
           </div>
        )
    }
}

export default Square
